import React from "react";
import styled from "styled-components";

const MyButton = styled.button`
    border-color: black;
    border-radius: 6px;
    background-color: white;
`

const Button = (props) => {
    return (
        <MyButton>
            {props.children}
        </MyButton>
    )
}

export default Button;
